		spectralUnmixingDesc: "ฟังก์ชั่น การคำนวณสัดสว่นผสมสเปคตรัมเชิงเส้น ทำหน้าที่คำนวณสิ่งปกคลุมที่เป็นองค์ประกอบสำหรับแต่ละพิกเซลที่ประกอบไปด้วยสิ่งปกคลุมดินประเภทต่าง ๆ โดยจะจัดทำชั้นข้อมูลแบบหลายแบนด์ โดยแต่ละแบนด์จะอ้างอิงกับความสมบูรณ์ขององค์ประกอบของสิ่งปกคลุมดินแต่ละประเภท เช่น คุณสามารถใช้ฟังก์ชั่นนี้เพื่อแยกประเภทสิ่งปกคลุมดินสำหรับภาพหลายช่วงคลื่นเพื่อระบุพืชสังเคราะห์แสง ความเป็นดิน และพืชที่ตายแล้วหรือไม่สังเคราะห์แสง<div><br/>ลำดับของแรสเตอร์หลายแบนด์ขาออกจะเป็นไปตามลำดับของโปรไฟล์สเปกตรัลขาเข้า จำนวนการแยกประเภทจะไม่เกินจำนวนแบนด์ในแรสเตอร์อินพุต เช่น คุณไม่สามารถคัดแยกข้อมูลมากกว่า 8 ประเภทจากแรสเตอร์ 8 แบนด์ได้</div>",
