		interpolateRasterByDimensionFunctionDesc: "<p>ฟังก์ชันนี้จะช่วยให้คุณสามารถประมาณค่าพิกเซลของสไลซ์มิติที่ไม่ได้กำหนดไว้ ในแรสเตอร์หลายมิติได้ เช่น หากคุณมีชุดข้อมูลที่มีอุณหภูมิน้ำทะเลที่ระดับพื้นผิว และ 100 เมตรใต้ระดับน้ำทะเล และคุณต้องการประมาณค่าอุณหภูมิที่ 50 เมตรใต้ระดับน้ำทะเล คุณสามารถใช้ฟังก์ชันนี้ในการรับค่าประมาณที่ระดับความลึกดังกล่าวได้ โดยใช้ข้อกำหนดมิติแบบ ตามค่า</p><p>และคุณยังสามารถดาวน์แซมเปิลชุดข้อมูลรายเดือน ให้เป็นชุดข้อมูลรายวันได้ โดยใช้ข้อกำหนดมิติ ตามช่วง และระบุค่าพารามิเตอร์ สเต็ป ให้เป็น 1 และค่าพารามิเตอร์หน่วยเป็น 1 </p><p>ใช้ข้อกำหนดขนาดแบบ ตามแรสเตอร์เป้าหมาย เพื่อประมาณค่าของแรสเตอร์เป้าหมาย</p>",
		multidimensionalFilterSnip: "จัดทำชั้นข้อมูลแรสเตอร์จากชุดข้อมูลแรสเตอร์หลายมิติ หรือชั้นข้อมูลแรสเตอร์หลายมิติโดยการแบ่งข้อมูลตามตัวแปรและมิติที่กำหนด",
		multidimensionalFilterDesc: "ตัวกรองหลายมิติจะจัดทำชั้นข้อมูลแรสเตอร์หลายมิติโดยการคัดกรองและคัดแยกชุดตัวแปรย่อยจากแรสเตอร์หลายมิติ เช่น หากคุณมีชุดข้อมูลหลายมิติที่มีข้อมูลหยาดน้ำฟ้ารายเดือนยาวนาน 30 ปี และต้องการคัดแยกข้อมูลสำหรับเดือนมกราคมในแต่ละปีเพื่อดูว่าหยาดน้ำฟ้ามีการเปลี่ยนแปลงอย่างไรสำหรับเดือนดังกล่าว<div><br/>ใช้พารามิเตอร์ คำจำกัดความของมิติ เพื่อแยกมิติต่าง ๆ เป็นช่วง เป็นค่าหรือช่วงของค่า เช่น หากคุณมีข้อมูลความเค็มของน้ำทะเลระยะ 10 ปีที่จัดเก็บทุกเดือนและในทุกความลึก 2 เมตรสูงสุดที่ 500 เมตร คุณสามารถใช้ตัวเลือกคำจำกัดความเชิงมิติต่าง ๆ สำหรับสถานการณ์ต่อไปนี้ สถานการณ์ที่ 1: คัดแยกข้อมูลความเค็มสำหรับเดือนมกราคมครอบคลุมระยะเวลา 10 ปี เลือกจากค่า กำหนด มิติ เป็น เวลามาตรฐาน และตั้งค่าเป็น มกราคม สถานการณ์ที่ 2: แบ่งข้อมูลความเค็มกับช่วงความลึก 0 - 150 เมตร เลือกจากช่วง ตั้งค่า มิติ เป็น Stdz และตั้งค่าต่ำสุดเป็น -150 และค่าสูงสุดเป็น 0 สถานการณ์ที่ 3: คัดแยกข้อมูลความเค็มสำหรับ 10 วันแรกของเดือนมกราคมแต่ละเดือนในช่วงระยะเวลา 10 ปี เลือกจากวงรอบ ตั้งค่า มิติ เป็น เวลามาตรฐาน ตั้งค่า เริ่มต้นวงรอบแรก และ สิ้นสุดวงรอบแรก เป็นระยะเวลาเริ่มต้นและสิ้นสุดของวงรอบที่เกี่ยวข้อง ตั้งค่า ขั้นตอน เป็น 1 และตั้งค่า หน่วย เป็น ปี</div>",
