		optimalPathAsRasterDesc: "ฟังก์ชันกลางนี้จะสร้างเอาท์พุทแรสเตอร์ ที่จะบันทึกเส้นทางต้นทุนที่เหมาะสมที่สุด หรือเส้นทางจากตำแหน่งที่ตั้งที่เลือก ไปยังเซลล์แหล่งต้นทางที่ใกล้ที่สุดที่กำหนดไว้ ภายในพื้นผิวต้นทุนสะสม ในแง่ของระยะทางต้นทุน<div><br/>ฟังก์ชั่นต้นทุนถ่วงน้ำหนักต่าง ๆ (การรวมระยะทาง หรือ การจัดสรรระยะทาง) มักต้องดำเนินการก่อนเรียกใช้ฟังก์ชั่น เส้นทางที่เหมาะสมสำหรับแรสเตอร์ เพื่อจัดทำผลรวมระยะทางขาเข้าและแรสเตอร์ทิศทางย้อนกลับ นี่เป็นชั้นข้อมูลแรสเตอร์อินพุตภาคบังคับสำหรับฟังก์ชั่น เส้นทางที่เหมาะสม ค่าดังกล่าวในเส้นทางที่เหมาะสมขาออกใช้ระบุจำนวนเส้นทางสำหรับตำแหน่งที่ระบุ ในหลาย ๆ กรณี เส้นทางจะเป็นเส้นทางเดียวกัน โดยปล่อยต้นทางไว้ตามเดิมแต่เปลี่ยนปลายทางไปต่าง ๆ กัน เช่น ค่าหนึ่งใช้ระบุว่ามีเส้นทางที่เหมาะสมเส้นทางเดียวสำหรับตำแหน่งที่ระบุ โดยค่าที่ห้าหมายถึงตำแหน่งดังกล่าวมีเส้นทางที่เหมาะสมห้าเส้นทางที่เคลื่อนผ่านเซลล์ดังกล่าวในพื้นที่ศึกษา<div><br/>ข้อมูลปลายทางขาเข้าจะต้องเป็นชั้นข้อมูลแรสเตอร์ ชุดเซลล์ปลายทางประกอบไปด้วยเซลล์ทั้งหมดในแรสเตอร์อินพุตที่มีค่าที่ถูกต้อง เซลล์ที่มีค่าเป็น ไม่มีข้อมูล จะไม่ถูกรวมอยู่ในชุดข้อมูลนี้ ค่าศูนย์ถือเป็นเส้นทางที่เหมาะสม แรสเตอร์ปลายทางสามารถจัดทำได้โดยใช้ชุดเครื่องมือคัดแยก หากคุณมีคุณสมบัติการทำงานสำหรับปลายทางหรือต้นทาง คุณสามารถแปลงข้อมูลเหล่านี้เป็นแรสเตอร์โดยใช้ฟังก์ชั่น แรสเตอร์ฟีเจอร์ ใช้ผลรวมระยะทางหรือแรสเตอร์ทิศทางย้อนกลับเป็นข้อมูลตั้งต้นแรสเตอร์สำหรับการคำนวณข้อมูลแรสเตอร์ ทั้งนี้เพื่อให้แน่ใจว่าข้อมูลคุณสมบัติที่เกี่ยวข้องจะถูกจัดทำเป็นแรสเตอร์โดยใช้ขนาดเซลล์ ขอบเขตและส่วนอ้างอิงเชิงพื้นที่เหมือน ๆ กันกับแรสเตอร์อื่น ๆ ที่ใช้ในฟังก์ชั่น เส้นทางที่เหมาะสมสำหรับแรสเตอร์ ฟังก์ชั่น เส้นทางที่เหมาะสมสำหรับแรสเตอร์ ยังสามารถใช้เพื่อพิจารณาเส้นทางที่มีความต้านทานน้อยที่สุดตามตัวแบบการยกระดับดิจิตอล (DEM) ในกรณีนี้ ให้ใช้ DEM สำหรับแรสเตอร์รวมระยะทางขาเข้า และข้อมูลขาออกจากฟังก์ชั่น ทิศทางการไกล สำหรับแรสเตอร์ทิศทางย้อนกลับ</div>",
