		shrinkDesc: "ฟังก์ชั่น ย่อโดยรวม จะทำให้คุณสามารถปรับหลักเกณฑ์ทั่วไป หรือลดความซับซ้อนของแรสเตอร์โดยการทำให้พื้นที่ที่กำหนดมีขนาดเล็กลง นอกจากนี้คุณยังสามารถควบคุมปริมาณการปรับหลักเกณฑ์ทั่วไปที่ต้องการได้<div><br/>พื้นที่ที่คุณเลือกจะหดลง หรือลดขนาดลง โดยใช้เซลล์จากพื้นที่โดยรอบมากลบไว้ ตามแนวคิดแล้ว ค่าโซน ที่เลือกจะสามารถเรียกดูเป็นพื้นที่เบื้องหน้า ในขณะที่ค่าอื่น ๆ จะยังคงถือเป็นพื้นที่เบื้องหลัง เซลล์ในพื้นที่เบื้องหน้าสามารถแทนที่ได้ด้วยเซลล์ในพื้นที่เบื้องหลัง หมู่เกาะเล็ก ๆ ในเขตพื้นที่ที่สามารถดูเป็นเขตพื้นที่แชร์ร่วมกันกับโซนสามารถถูกแทนที่ได้เช่นกัน<div><br/>ระดับการกำหนดหลักเกณฑ์ทั่วไปสามารถควบคุมได้จากพารามิเตอร์ จำนวนเซลล์ ตามค่าเริ่มต้น ค่าจะเป็น 1 ซึ่งหมายถึงพื้นที่ที่เลือกจะหดลงตามจำนวนที่สอดคล้องกับขนาดของเซลล์หนึ่งเซลล์ เพิ่มระดับการกำหนดหลักเกณฑ์ทั่วไป โดยระบุค่าที่สูงขึ้นสำหรับพารามิเตอร์นี้ ตามหลักแล้ว นี่จะเป็นเหมือนกับการเรียกใช้เครื่องมือหลาย ๆ ครั้งตามจำนวนที่ระบุ โดยผลของการดำเนินการครั้งก่อนหน้าจะถูกใช้เป็นข้อมูลตั้งต้นสำหรับรอบการทำงานถัดไป</div>",
