		aggregateMultidimensionalDesc: "ฟังก์ชันรวมหลายมิติ จะสร้างชั้นข้อมูลแรสเตอร์หลายมิติโดยการรวมข้อมูลตัวแปรแรสเตอร์หลายมิติที่มีอยู่ตามมิติ<div><br>ใช้พารามิเตอร์ <strong>นิยามมิติ</strong> เพื่อกรองข้อมูลอินพุทที่คุณต้องการรวมก่อน เช่น หากคุณข้อมูลรายเดือนทั้งหมด 30 ปี แต่ต้องการสร้างชั้นข้อมูลรวมของ 15 ปีแรก คุณสามารถใช้พารามิเตอร์ <strong>นิยามมิติ</strong> เพื่อกำหนดปีที่จะใช้ในการวิเคราะห์ได้<div><br><ul><li>แยกข้อมูลความเค็มของเดือนมกราคมในช่วงเวลา 10 ปี เลือก <strong>ตามค่า</strong>, ตั้งค่า <strong>มิติ</strong> เป็น <strong>StdTime</strong>, และตั้ง <strong>ค่า</strong> เป็น <strong>มกราคม</strong>.</li><li>สไลซ์ข้อมูลความเค็มในช่วงความลึก 0 ถึง 150 เมตร เลือก <strong>ตามช่วง</strong>, ตั้งค่า <strong>มิติ</strong> เป็น <strong>StdZ</strong>, และตั้งค่า <strong>ค่าขั้นต่ำ</strong> เป็น <strong>-150</strong> และ <strong>ค่าขั้นต่ำ</strong> เป็น <strong>0</strong></li><li>แยกข้อมูลความเค็มของ 10 วันแรกในทุก ๆ เดือนมกราคมตลอดช่วงเวลา 10 ปี เลือก <strong>ตามการวนซ้ำ</strong>, ตั้งค่า <strong>มิติ</strong> เป็น <strong>StdTime</strong>, ตั้งค่า <strong>เริ่มต้นการวนซ้ำครั้งแรก</strong> และ <strong>สิ้นสุดการวนซ้ำครั้งแรก</strong> ให้เป็นการเริ่มต้นและการสิ้นสุดช่วงเวลาการวนซ้ำที่สอดคล้องกัน ตั้งค่า <strong>ขั้นตอน</strong> เป็น <strong>1</strong> และตั้งค่า <strong>หน่วย</strong> เป็น <strong>ปี</strong></li></ul><div><br>ใช้พารามิเตอร์ <strong>นิยามการรวม</strong> เพื่อเลือกมิติที่จะประเมินและช่วงเวลาการรวมโดยใช้คำสำคัญค่าและช่วงของค่า เช่น หากคุณมีข้อมูลอุณหภูมิพื้นผิวน้ำทะเล 30 ปี ซึ่งเก็บรวบรวมทุกวันในทุกระดับความลึก 5 เมตรไปจนถึง 100 เมตร คุณสามารถใช้ตัวเลือกช่วงเวลาที่แตกต่างกันในสถานการณ์ต่อไปนี้ได้:<div><br><ul><li>รวมข้อมูลอุณหภูมิรายวันเป็นข้อมูลรายเดือน โดยที่ผลลัพธ์คือแรสเตอร์หลายมิติ ซึ่งมี 12 สไลซ์เวลา และแต่ละสไลซ์คือผลรวมของแต่ละเดือนจากทุกปี เลือก <strong>คำสำคัญช่วงเวลา</strong> และตั้งค่าคำสำคัญเป็น <strong>เกิดซ้ำรายเดือน</strong></li><li>รวมข้อมูลอุณหภูมิรายวันเป็นข้อมูลรายเดือน โดยที่ผลลัพธ์คือแรสเตอร์หลายมิติที่มี 360 สไลซ์ หรือ 12 สไลซ์เวลาต่อปี (30 ปี x 12 เดือน = 360 สไลซ์) เลือก <strong>คำสำคัญช่วงเวลา</strong> และตั้งค่าคำสำคัญเป็น <strong>รายเดือน</strong></li><li>รวมข้อมูลอุณหภูมิรายเดือนเป็นช่วงเวลา 4 เดือน เลือก <strong>ค่าช่วง</strong>, ตั้งค่า <strong>ค่าช่วง</strong> เป็น 4, และตั้งค่า <strong>หน่วย</strong> เป็น <strong>เดือน</strong></li><li>รวมข้อมูลอุณหภูมิจาก 0 ถึง 25 เมตร ตามด้วย 25 ถึง 50 เมตร และจาก 50 ถึง 100 เมตร เลือก <strong>พิสัยช่วง</strong> จากนั้นกำหนดความลึกขั้นต่ำและสูงสุดเป็น <strong>0 25; 25 50; 50 100</strong></li></ul>",
